//componenets
import Logo from "../components/Logo";
import Login from "../components/Login";

const LoginSign = (props) => {
  return (
    <>
      <div id="loginSign">
        <Login show={true} />
        <button onClick={props.toggle}>Sign Up</button>
      </div>
    </>
  );
};

export default LoginSign;
